mapper.select:

select 

from jvd_sanrentan_hyosu
where RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN1 = #{sanrentanKumiban1,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN2 = #{sanrentanKumiban2,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN3 = #{sanrentanKumiban3,jdbcType=CHAR}

mapper.delete:

delete from jvd_sanrentan_hyosu
where RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN1 = #{sanrentanKumiban1,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN2 = #{sanrentanKumiban2,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN3 = #{sanrentanKumiban3,jdbcType=CHAR}

mapper.update:

update jvd_sanrentan_hyosu

  
    INSERT_TIMESTAMP = #{insertTimestamp,jdbcType=TIMESTAMP},
  
  
    UPDATE_TIMESTAMP = #{updateTimestamp,jdbcType=TIMESTAMP},
  
  
    RECORD_SHUBETSU_ID = #{recordShubetsuId,jdbcType=CHAR},
  
  
    DATA_KUBUN = #{dataKubun,jdbcType=CHAR},
  
  
    DATA_SAKUSEI_NENGAPPI = #{dataSakuseiNengappi,jdbcType=TIMESTAMP},
  
  
    SANRENTAN_HYOSU = #{sanrentanHyosu,jdbcType=DECIMAL},
  
  
    SANRENTAN_NINKIJUN = #{sanrentanNinkijun,jdbcType=DECIMAL},
  

where RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN1 = #{sanrentanKumiban1,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN2 = #{sanrentanKumiban2,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN3 = #{sanrentanKumiban3,jdbcType=CHAR}


update jvd_sanrentan_hyosu
set INSERT_TIMESTAMP = #{insertTimestamp,jdbcType=TIMESTAMP},
  UPDATE_TIMESTAMP = #{updateTimestamp,jdbcType=TIMESTAMP},
  RECORD_SHUBETSU_ID = #{recordShubetsuId,jdbcType=CHAR},
  DATA_KUBUN = #{dataKubun,jdbcType=CHAR},
  DATA_SAKUSEI_NENGAPPI = #{dataSakuseiNengappi,jdbcType=TIMESTAMP},
  SANRENTAN_HYOSU = #{sanrentanHyosu,jdbcType=DECIMAL},
  SANRENTAN_NINKIJUN = #{sanrentanNinkijun,jdbcType=DECIMAL}
where RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN1 = #{sanrentanKumiban1,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN2 = #{sanrentanKumiban2,jdbcType=CHAR}
  and SANRENTAN_KUMIBAN3 = #{sanrentanKumiban3,jdbcType=CHAR}
